import React, { useEffect, useState } from 'react';
import axios from 'axios';
import { Link } from 'react-router-dom';
import { useTable, useSortBy, useFilters } from 'react-table';
import RouterModal from './RouterModal';
import './RouterTable.css';

const RouterTable = () => {
  const [routers, setRouters] = useState([]);
  const [networks, setNetworks] = useState([]);
  const [isModalOpen, setIsModalOpen] = useState(false);
  const [selectedRouter, setSelectedRouter] = useState(null);
  const [isLoading, setIsLoading] = useState(true);
  const [error, setError] = useState(null);

  // Fetch routers and networks from the server
  useEffect(() => {
    setIsLoading(true);
    const fetchData = async () => {
      try {
        const [routersResponse, networksResponse] = await Promise.all([
          axios.get('http://127.0.0.1:5000/api/routers'),
          axios.get('http://127.0.0.1:5000/api/networks'),
        ]);

        setRouters(routersResponse.data);
        setNetworks(networksResponse.data);
      } catch (error) {
        console.error('Error fetching data:', error);
        setError('Failed to load data from the server.');
      } finally {
        setIsLoading(false);
      }
    };

    fetchData();
  }, []);

  const getNetworkDetails = (networkId) => {
    return networks.find((network) => network.id === networkId) || {};
  };

  const data = React.useMemo(
    () =>
      routers.map((router) => {
        const { name: networkName, color: networkColor } = getNetworkDetails(router.network_id);
        return {
          ...router,
          networkName: networkName || 'Unknown',
          networkColor: networkColor || '#FFFFFF',
        };
      }),
    [routers, networks]
  );

  const columns = React.useMemo(
    () => [
      {
        Header: 'ID',
        accessor: 'id',
      },
      {
        Header: 'Name',
        accessor: 'name',
      },
      {
        Header: 'IP Address',
        accessor: 'ip_address',
      },
      {
        Header: 'Floor',
        accessor: 'floor',
      },
      {
        Header: 'Building',
        accessor: 'building',
      },
      {
        Header: 'Network',
        accessor: 'networkName',
      },
      {
        Header: 'Actions',
        Cell: ({ row }) => (
          <button onClick={() => handleMoreClick(row.original)}>More</button>
        ),
      },
    ],
    []
  );

  const {
    getTableProps,
    getTableBodyProps,
    headerGroups,
    rows,
    prepareRow,
  } = useTable({ columns, data }, useFilters, useSortBy);

  const handleMoreClick = (router) => {
    setSelectedRouter(router);
    setIsModalOpen(true);
  };

  const handleCloseModal = () => {
    setSelectedRouter(null);
    setIsModalOpen(false);
  };

  if (isLoading) return <div>Loading...</div>;
  if (error) return <div style={{ color: 'red' }}>{error}</div>;

  return (
    <div>
      <div style={{ marginBottom: '10px' }}>
        <Link to="/add-router">
          <button>Add Router</button>
        </Link>
      </div>
      <div className="table-container">
        <table {...getTableProps()} className="router-table">
          <thead>
            {headerGroups.map((headerGroup) => (
              <tr {...headerGroup.getHeaderGroupProps()}>
                {headerGroup.headers.map((column) => (
                  <th {...column.getHeaderProps(column.getSortByToggleProps())}>
                    {column.render('Header')}
                    <span>
                      {column.isSorted
                        ? column.isSortedDesc
                          ? ' ðŸ”½'
                          : ' ðŸ”¼'
                        : ''}
                    </span>
                  </th>
                ))}
              </tr>
            ))}
          </thead>
          <tbody {...getTableBodyProps()}>
            {rows.map((row) => {
              prepareRow(row);
              return (
                <tr
                  {...row.getRowProps()}
                  style={{ backgroundColor: row.original.networkColor }}
                >
                  {row.cells.map((cell) => (
                    <td {...cell.getCellProps()}>{cell.render('Cell')}</td>
                  ))}
                </tr>
              );
            })}
          </tbody>
        </table>
      </div>

      {isModalOpen && selectedRouter && (
        <RouterModal router={selectedRouter} onClose={handleCloseModal} />
      )}
    </div>
  );
};

export default RouterTable;
